const ProductReducer = (product = [], action) => {
  switch (action.type) {
    case "FETCH_SUCCESSED":
      return action.receivedProduct;

    case "FETCH_FAILED":
      return action.receivedProduct;

    default:
      return product;
  }
};

export default ProductReducer;
